import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; //

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
const root = document.getElementById('root');
ReactDOM.createRoot(root).render(<App />);
